Insert into JCART_CLOTHING (PRODUCTID,COMPANY,PRODUCTNAME,IDEALFOR,DESCRIPTION,FABRIC) values (10002,'Van Heusen','Shirt','M','Achieving an elegant formal look effortlessly is made possible with this striped formal mens shirt by Van Heusen. Crafted from 100 per cent cotton, this classic fit shirt has light grey stripes. ','100% Cotton');
